import React from 'react';
import { useLocation } from 'react-router-dom';

export default function Navbar_settings() {
  const location = useLocation();

  return (
    <nav className="navbar-settings">
      <li className={location.pathname === '/settings/accounts' ? 's-li-active' : ''}>
        <a href="/settings/accounts">Accounts</a>
      </li>
      <li className={location.pathname === '/settings/logout' ? 's-li-active' : ''}>
        <a href="/settings/logout">Logout</a>
      </li>
      <li className={location.pathname === '/settings/darkmode' ? 's-li-active' : ''}>
        <a href="/settings/darkmode">Dark Mode</a>
      </li>
    </nav>
  );
}
